import React from 'react';
//import { ReactComponent as Logo } from '../img/logo.png';
import logo from '../img/logo.png';
import "./Header.css";
import { Link } from "react-router-dom";
import SearchIcon from "@material-ui/icons/Search";
import PeopleIcon from '@material-ui/icons/People';
import db from '../firebase';

function Header() {
    function onSubmit() {
        var provider = new db.auth.GoogleAuthProvider();
    }
    return (
        <nav className="header">
            <Link to="/">
                <img src={logo} alt="logo image" className="header__logo" />
                {/* <Logo className="header__logo" /> */}
            </Link>
            <div className="header__search">
                <input type="text" className="header__searchInput" />
                <SearchIcon className="header__searchIcon" />
            </div>
            <div className="header__nav">
                <Link to="/login" className="header__link">
                    <div className="header__option" onClick={this.onSubmit}>
                        <span className="header__optionLineOne">Hello</span>
                        <span className="header__optionLineTwo">Sign In <PeopleIcon className="header__optionLineTwo" /></span>
                    </div>
                </Link>
            </div>
        </nav>
    )
}

export default Header
